import React from 'react';
import './App.css';
import { HashRouter, Route } from 'react-router-dom';
import About from './routes/About';

function App(){
	return (
		<HashRouter>

				<Route path="/about" component={About}></Route>

		</HashRouter>
	);
}

export default App;
